        'value'         : msg.payload,
        'sensor'        : msg.sensor
    }
};
return newMsg;

msg={};
msg.payload={};
msg.payload.propertyNameInForm='';

return msg;

var ms = parseInt(msg.payload);

var totalSec = ms/1000;

var hours = Math.trunc(totalSec/3600);
var minutes = Math.trunc(totalSec%3600/60);
var seconds = totalSec%60;

msg.payload = "Stopped alert for ";

if(hours>0){
    msg.payload += hours;
    msg.payload += (hours>1)?' hours ':' hour ';
    msg.payload += minutes;
    msg.payload += (minutes>1)?' minutes ':' minute ';
    msg.payload += seconds;
    msg.payload += (seconds>1)?' seconds':' second';
}else{
    if(minutes>0){
        msg.payload += minutes;
        msg.payload += (minutes>1)?' minutes ':' minute ';
        msg.payload += seconds;
        msg.payload += (seconds>1)?' seconds':' second';
    }else{
        if(seconds>0){
            msg.payload += seconds;
            msg.payload += (seconds>1)?' seconds':' second';
        }
    }
}

msg.payload += '.';

return msg;

//msg.payload = msg.payload + " - " + new Date().toString();
msg.payload = {value:msg.payload, timestamp:new Date().toString()};
return msg;

//msg.payload = msg.payload + " - " + new Date().toString();
msg.payload.timestamp = new Date();
return msg;

var hours = msg.payload['hours'];
var minutes = msg.payload['minutes'];
var seconds = msg.payload['seconds'];

if(hours==null){
    hours=0;
}
if(minutes==null){
    minutes=0;
}
if(seconds==null){
    seconds=0;
}

if(hours>=0 && minutes>=0 && seconds>=0){
    if(hours>0 || minutes>0 || seconds>0){
        if(Number.isInteger(hours) && Number.isInteger(minutes) && Number.isInteger(seconds)){
            if(hours<24){
                if(minutes<60){
                    if(seconds<60){
                        seconds += hours*60*60;
                        seconds += minutes*60;
                        var milliseconds = seconds*1000;
                        msg.payload = milliseconds.toString();
                        msg.condition = true;
                    }else{
                        msg.payload = "Please enter seconds below 60.";
                        msg.condition = false;
                    }
                }else{
                    msg.payload = "Please enter minutes below 60.";
                    msg.condition = false;
                }
            }else{
                msg.payload = "Please enter hours below 24.";
                msg.condition = false;
            }
        }else{
            msg.payload = "Please enter only integer.";
            msg.condition = false;
        }
    }else{
        msg.payload = "Please fill in at least 1 field with greater than 0 to update.";
        msg.condition = false;
    }
}else{
    msg.payload = "Please do not enter negative values.";
    msg.condition = false;
}


return msg;

var ms = parseInt(msg.payload);

var totalSec = ms/1000;

var hours = Math.trunc(totalSec/3600);
var minutes = Math.trunc(totalSec%3600/60);
var seconds = totalSec%60;

msg.duration="";

if(hours>0){
    msg.duration += hours;
    msg.duration += (hours>1)?' hours ':' hour ';
    msg.duration += minutes;
    msg.duration += (minutes>1)?' minutes ':' minute ';
    msg.duration += seconds;
    msg.duration += (seconds>1)?' seconds':' second';
}else{
    if(minutes>0){
        msg.duration += minutes;
        msg.duration += (minutes>1)?' minutes ':' minute ';
        msg.duration += seconds;
        msg.duration += (seconds>1)?' seconds':' second';
    }else{
        if(seconds>0){
            msg.duration += seconds;
            msg.duration += (seconds>1)?' seconds':' second';
        }
    }
}

return msg;

// Move our signup data to a different part of the msg
msg.signupData = msg.payload;

// Update the msg.payload to contain the email text.
msg.payload = msg.signupData.email;

// Finally, return the entire message object which forwards 
// everything along the chain.
return msg;

